import React from 'react'

function Follower({follower}) {
    return (
        <div className = "card">

            <p>Name: {follower.name}</p>
            <p>Login name: {follower.login}</p>
            <p>Location: {follower.location}</p>
            <img src={follower.avatar_url} alt="avartar" />



        </div>
    )
}

export default Follower
